import React from "react";

export default function SetAngle({angle,setAngle}) {
    return(
        <div className="form-group align-items-center justify-content-center gap-3 mb-3" style={{width:"65%"}}>
            <label htmlFor="setAngle" className="text-warning" style={{fontWeight:"bold",fontSize:"1.5em"}}>Example range</label>
            <input type="number" value={angle} onChange={e => {setAngle(e.target.value)}} name="setAngle"></input>
            <input type="range" min="0" max="360" className="form-range" name="setAngle"></input>
        </div>
    )
}
